import java.util.*;public class Solution{    public static void main(String[] args){        Scanner s=new Scanner(System.in);        int n=s.nextInt();        s.nextLine();        String s1=s.nextLine();        String h[]=new String[n];        int count=0;        for(int i=0;i<n;i++)            h[i]=s.nextLine();        for(int j=0;j<n;j++){            if(h[j].contains(s1))                count++;        }        if(count==n && count%2==0)            System.out.println("home");        else            System.out.println("contest");               }}
